// Transform Shopify orders into FAIM-ready format (2D univariate batch)
// FAIM node accepts 2D format: [batch][sequence]
// Shape: [batch=3 SKUs][sequence=365 days]
// The ShapeConverter will internally convert to 3D: [3][365][1]

const orders = $input.first().json.orders;

// Get unique dates and SKUs
const skus = ['SKU-001-WIDGET', 'SKU-002-GADGET', 'SKU-003-TOOL'];
const dates = [...new Set(orders.map(o => o.date))].sort();

// Create 2D array: [batch][sequence]
// batch = 3 SKUs, sequence = 365 days
const timeSeriesData = [];

for (const sku of skus) {
  // For each SKU, create sequence of quantities (no feature wrapping)
  const skuSequence = [];

  for (const date of dates) {
    const order = orders.find(o => o.sku === sku && o.date === date);
    const quantity = order ? order.quantity : 0;
    skuSequence.push(quantity);
  }

  // Add this SKU's sequence to batch
  timeSeriesData.push(skuSequence);
}

console.log('Transform output shape (2D univariate):');
console.log('  batch (SKUs):', timeSeriesData.length);
console.log('  sequence (days):', timeSeriesData[0]?.length);

return [{
  json: {
    time_series: timeSeriesData,
    shape: { batch: timeSeriesData.length, sequence: timeSeriesData[0]?.length },
    skus: skus,
    last_date: dates[dates.length - 1]
  }
}];

// Process FAIM forecast output and format for Google Sheets
// Backend returns 3D: [batch][sequence][features]
// We need to flatten to 2D: [batch][sequence] for easier processing

const input = $input.first().json;
const transformNode = $node['Transform to FAIM Format'].json;
const skus = transformNode.skus;

// Get forecast data - backend returns 3D [batch][sequence][features]
let forecastData;
if (input.forecast?.point) {
  forecastData = input.forecast.point;
} else if (input.forecast?.quantiles) {
  forecastData = input.forecast.quantiles;
} else {
  throw new Error('No forecast data found. Available keys: ' + JSON.stringify(Object.keys(input)));
}

console.log('=== PROCESSING FORECAST ===');
console.log('Forecast shape: [' + forecastData.length + '][' + (forecastData[0]?.length || 0) + '][' + (forecastData[0]?.[0]?.length || 0) + ']');

// Flatten 3D to 2D: extract [features][0] from each [batch][sequence][features]
const forecast2D = forecastData.map(batch => 
  batch.map(sequence => {
    // sequence is [features], so extract first element
    return Array.isArray(sequence) ? sequence[0] : sequence;
  })
);

console.log('Flattened to 2D shape: [' + forecast2D.length + '][' + (forecast2D[0]?.length || 0) + ']');

// Format output: one row per SKU with day_1 through day_30 columns
const sheetsData = [];

for (let skuIdx = 0; skuIdx < skus.length; skuIdx++) {
  console.log('Processing SKU', skuIdx, ':', skus[skuIdx]);
  const row = { SKU: skus[skuIdx] };

  // Add columns day_1 through day_30
  const skuData = forecast2D[skuIdx];
  if (!skuData) {
    throw new Error('No forecast data for SKU ' + skuIdx);
  }

  for (let day = 0; day < Math.min(30, skuData.length); day++) {
    const quantity = skuData[day] || 0;
    row['day_' + (day + 1)] = Math.max(0, Math.round(quantity));
  }

  // Fill remaining days with 0 if less than 30 days forecast
  for (let day = skuData.length; day < 30; day++) {
    row['day_' + (day + 1)] = 0;
  }

  sheetsData.push(row);
}

console.log('Total rows created:', sheetsData.length);
console.log('=== END PROCESSING ===');

return [{
  json: { data: sheetsData }
}];
